import "./R4c4Copy.css";

const R4c4Copy = ({ onClose }) => {
  return (
    <div className="r4c4-copy-div">
      <div className="r4c4-content-div">
        <span className="r4c4-content-txt-span">
          <p className="vehicletroller-1-p2">Vehicle:troller 1</p>
          <p className="vehicletroller-1-p2">Sáng: MCP 1</p>
          <p className="chiu-mcp-22">Chiều: MCP 2</p>
        </span>
      </div>
      <div className="r4c4-text-div">22</div>
    </div>
  );
};

export default R4c4Copy;
